<dialog id="modal" class="modal">
</dialog>

<style>
.modal {
  padding: 2rem;
  border: 0;
  border-radius: 0.5rem;
  position: fixed;
  top: -30vw;
  font-family: Verdana;
}

.modal-close-btn {
  font-size: .75em;
  position: absolute;
  top: .25em;
  right: .25em;
  font-family: Verdana;
}

</style>

<script>

function set_up_dialog(inner_html) {

	inner_html += "<p/><button id=\"closeModal\" class=\"modal-close-btn\">&#x2715;</button>";	
	const dialog = document.getElementById('modal');
	dialog.innerHTML = inner_html;
	dialog.showModal();

	const closeDialogButton = document.getElementById('closeModal');

	closeDialogButton.addEventListener('click', () => {
		dialog.close();
	});
}

</script>




<script>

function f_word(w, c, ts) {
	inner_html = "";
	inner_html += "<ul><li>Word: [<b>" + w + "</b>]</li><li>Conf: " + c + "</li><li>Style: " + ts + "</li></ul>";
	set_up_dialog(inner_html);
}

function f_cell(row, col, contains, kind) {
  inner_html = "<ul>";
  inner_html += "<li>" + kind + "</li>"
  inner_html += "<li>" + "Row:" + row + "</li>"
  inner_html += "<li>" + "Column:" + col + "</li>"
  inner_html += "<li>" + "Contains: " + "<b>" + contains + "</b>" + "</li>"
  inner_html += "</ul>";
  set_up_dialog(inner_html);
}
</script>
